import React from 'react';
import styles from '../index.css';

const Nav = () => {
  return (
    <nav className={styles.navbar}>
      <div className={styles.navcontainer}>
        <logo/> 
        <h1>FEB14 Practice</h1>
        <ul className={styles.navList}>
          <li>HOME</li>
          <li>PAGE2</li>
          <li>PAGE3</li>
          <li>PAGE4</li>
        </ul>
      </div>
    </nav>
  );
};

export default Nav;
